window.bookSummaryJSON = "<p>Michael returns to fulfill a promise to his love, but the world isn't the same place.</p> <p>Michael just wants a little sleep. The last few days have been a bit of a learning overload after coming back 150 years after he was blown apart by a backpack nuke.</p> <p>The world destroyed itself, there are anti-gravity cars and ships, and his love is in the stars...somewhere.</p> <p>Plus, there is a vampire trying to make Europe his personal fiefdom. Akio and Yuko are trying to find him, and he has a young female <i>Wechselbalg </i>and male vampire to keep on the straight and narrow.</p> <p>Michael has his own brand of justice, and this world is now understanding the Patriarch is back.</p> <p>Nothing will be the same.</p> <p>As noted in other series set in the Kurtherian Universe, there is cursing in this audiobook occasionally - it's funny, too.</p>"; 
